import React, {useState} from 'react';
import styles from "./DriverStatus.module.scss";


const DriverStatus = () => {
  const [driverStatus, setDriverStatus] = useState('свободен')

  return (
    <div>
      <p className={styles.status}>
        {driverStatus}
      </p>
      <div className={styles.change_status}>
        <button onClick={setDriverStatus('свободен')}>Свободен</button>
        <button onClick={setDriverStatus('занят')}>Занят</button>
      </div>
    </div>
  )
};

export default DriverStatus;
